            <div class="center">
                <img src="03-min.jpg">
            </div>


            <h1><span>2018 год показал рекордные данные по количеству мужчин с импотенцией в Украине. Страшные факты и новый подход к решению проблемы раз и навсегда! </span>
            </h1>

            <p>Российским обществом урологов на <span class="red">29 всемирном конгрессе по урологии</span> был представлен доклад с устрашающей статистикой по количеству урологических заболеваний в Украине.</p>
            <div class="center">
                <img src="01-min.jpg">
            </div>
            <p class="desc">Аляев Юрий Геннадьевич. Руководитель клиники и кафедры урологии Первого МГМУ, заместитель
                директора Научно-исследовательского института уронефрологии и репродуктивного здоровья человека,
                член-корреспондент РАН, профессор, известный ученый-уролог</p>
            <p>Улучшение диагностики, испытание новых методов и неэффективность больничного лечения - главные темы, которые обсуждали на конференции.</p>
            <p>Как итог, урологи привели статистику за 16 лет работы:</p>
            <ol>
                <li>За период 2002 - 2018 год стало на 60.5% больше пациентов с заболеваниями мочеполовой системы.
                </li>
                <li>Случаи мужского полового бессилия выросли на 57%.</li>
                <li>Заболеваний злокачественными новообразованиям стало на 180.7% больше, что означает увеличение втрое по сравнению с 2002 годом.
                </li>
            </ol>
            <div class="center">
                <img src="05-min.jpg">
            </div>

            <h2>Почему проблема эректильной дисфункции важна для нашей страны? </h2>
            <p>Украинские мужчины затягивают с лечением, игнорируя первые признаки плохой потенции и простатита. Но болезнь всегда развивается поэтапно.</p>
            <h3>Этапы развития импотенции и их последствия</h3>
            <p><b>Стадия 1.</b> Потенция пропадает изредка – например, после приема алкоголя или сама по себе. Иногда
                отсутствует «настроение заниматься сексом». Большинство людей списывают это на тяжелую работу, стрессы и
                прочее. Однако это уже первый признак того, что со временем будет только хуже.</p>
            <p><b>Стадия 2.</b> Потенция пропадает все чаще. Даже, когда есть, не такая твердая, как раньше. Член может
                опадать во время полового акта или при надевании презерватива. Как правило, человек в этот период
                начинает задумываться о проблеме, однако ограничивается лишь тем, что иногда принимает виагру.</p>
            <p><b>Стадия 3.</b> Потенция появляется изредка. Резко понижается либидо. Мужчина становится
                раздражительным, пропадают силы и желание что-либо делать. Начинаются семейные проблемы – частая ругань
                в семье, женские измены, дело может дойти до развода.</p>
            <p><b>Стадия 4.</b> Полная импотенция. Не помогает даже виагра. До 91% мужчин на этой стадии становятся
                одинокими – женщины редко живут с импотентами, а если живут, то мучаются. Развивается депрессия, а также
                различные физические недуги. Наш организм устроен так, что его основная функция – размножение. Как
                только он ее лишается, организм начинает очень быстро разрушаться.</p>
            <p class="bg">У 90% МУЖЧИН В УКРАИНЕ - ПРОБЛЕМЫ В ПОСТЕЛИ, а 73% мужчин уже к 40 годам становятся
                импотентами!</p>
            <p>Такие кажущиеся незначительными на первый взгляд симптомы на первых этапах почти всегда ведут к
                непоправимым последствиям:</p>
            <p><b>Импотенция</b></p>
            <div class="center blur">
                <img src="impotencia.jpg">
                <p class="blur-p">Показать фото</p>
            </div>
            <p><b>Рак простаты.</b> Самая частая причина смерти (до 88%) у мужчин, страдающих от импотенции.</p>
            <div class="center blur">
                <img src="rak.jpg">
                <p class="blur-p">Показать фото</p>
            </div>
            <p><b>Аденома простаты</b></p>
            <div class="center blur">
                <img src="adenoma.jpg">
                <p class="blur-p">Показать фото</p>
            </div>

            <p><b>Камни в почках.</b> Почечнокаменная болезнь также развивается из-за ухудшения кровоснабжения органов
                малого таза.</p>
            <div class="center blur">
                <img src="kamni.png">
                <p class="blur-p">Показать фото</p>
            </div>

            <div class="kov">
                <p>«Нерегулярная половая жизнь снижает продолжительность жизни и ведет к преждевременному старению.</p>
                <p>Простатит возникает в 100% случаях, т.е. у каждого мужчины, который страдает импотенцией и не имеет
                    сексуальной активности.»</p>
                <p class="avtor">А.Л. Михеев, профессор, доктор мед. наук, заслуженный врач Украины</p>
            </div>
            <h2>Виагра – синтетический препарат убийца </h2>
            <p>Ввиду того, что потенция может пропасть полностью, многие мужчины стараются избавиться от проблем с
